INSERT INTO `messages` (`id`, `sender_player_id`, `recipient_player_id`, `subject`, `message`, `sender_state`, `recipient_state`, `created`) VALUES
(1, 3, 2, 'yo!', 'Get off my land now or you''re going down! I own this kingdom.', 0, 1, '2010-09-06 03:06:41'),
(2, 3, 1, 'hey', 'I''m gonna raze Payon to the ground. Just give up.\rBTW, why can''t I just select players for the To field (combobox)?', 0, 1, '2010-09-06 03:08:10'),
(3, 3, 1, 'game problems so far', '1) Registration screen should tell me right away I need 5 characters in name and it contains only letters and numbers - Q-man or Qman didn''t work - annoying since I have to type that stupid captcha each time.\r2) Should tell the user to turn off AdBlock so you can make some money in home page or something - it allows just unblocking your domain.', 0, 1, '2010-09-06 03:16:34'),
(4, 3, 1, 'looting', 'Am I supposed to be able to loot yet? I just looted 50 resources from you - didn''t really notice my resource count increase though.', 0, 1, '2010-09-06 03:22:54'),
(5, 1, 3, 'Re: looting', 'loot? how did you loot? ', 0, 1, '2010-09-06 03:25:13'),
(6, 3, 1, 'Re: looting', 'In my Resources Stolen column, I see "50" from your row.', 0, 1, '2010-09-06 03:27:49'),
(7, 1, 3, 'Re: looting', 'lol... thats ranking overall.. not you only', 0, 1, '2010-09-06 03:28:58'),
(8, 3, 1, 'roads', 'what do I need roads for? you build them to the training grounds, anthony just builds them not connected to anything.', 0, 1, '2010-09-06 03:29:33'),
(9, 1, 3, 'Re: roads', 'you need road to conect to buildings other than farm and lumbermill and a couple others.. but you can build them anywhere you want as well', 0, 1, '2010-09-06 03:30:57'),
(10, 3, 1, 'Improvement 1 - resource x/max', 'It would be useful to see my resources displayed as 117/1100 instead of just 117.', 0, 1, '2010-09-06 03:33:31'),
(11, 1, 3, 'Re: Improvement 1 - resource x/max', 'mouse over and you see the max .. it''ll show up green if it''s full ', 0, 1, '2010-09-06 03:34:45'),
(12, 3, 1, 'actually - improvement 1', 'I see it displayed when I mouse over. I guess that''s partially covered.', 0, 1, '2010-09-06 03:35:03'),
(13, 1, 3, 'Re: actually - improvement 1', 'i was worried ppl wouldnt understand the lumbermill thing too easy but it looks like you found where we were getting wood from easily.. that''s good', 0, 1, '2010-09-06 03:38:08'),
(14, 3, 1, 'Re: actually - improvement 1', 'Took a while of dragging. Maybe a hint to scroll around for a big tree would help - I tried double-clicking the grass and the scrap wood planks within my walls and that wasn''t it.', 0, 1, '2010-09-06 03:41:54'),
(15, 3, 1, 'nothing left to do', 'Looks like there''s nothing left to do. It''s gonna take forever to get Training Grounds next so that looks like tomorrow at the grow rate of 5 an hour.', 0, 1, '2010-09-06 03:45:11'),
(16, 1, 3, 'Re: nothing left to do', 'yeah it''s a tiny bit slow in the beginning  .. we might need to bump up the number of laborers you start with or something like that so you can get resources faster', 0, 1, '2010-09-06 03:47:42'),
(17, 3, 1, 'gather wood vs farming', 'Is it a good idea to assign more laborers to my farm? I only have 5 at the farm and 15 at the lumber mill. I need more wheat since training grounds need 180 and lumber mill upgrade needs 190 and I only have 130 with rate of 5 an hour.\r\rIs there a reason why I was only able to assing 5 laborers to farm earlier? it didn''t allow more. Can I add more now? (20 minute laborer assign time is a long wait btw)', 0, 1, '2010-09-06 03:49:15'),
(18, 1, 3, 'Re: gather wood vs farming', 'you can assign 5 at a time but i believe lvl 1 is max of 20 or 25 total .. yeah i might make assigning a bit quicker', 0, 1, '2010-09-06 03:50:43'),
(19, 1, 3, 'Re: gather wood vs farming', 'when you first joined travian .. did you just upgrade the resource field for like 5 days? did it take forever to get a military? we''re trying to make it so you can start attacking within 3 days of playing and be able to start looting resources', 0, 1, '2010-09-06 03:54:56'),
(20, 3, 1, 'Re: gather wood vs farming', 'Check the travian build guide sites for info on what people advise to do for new players. I don''t think it was 5 days. I thought it was earlier. You were protected from being attacked for a few days though - forgot how long, but I thought you could start raiding pretty soon.', 0, 1, '2010-09-06 03:58:34'),
(21, 3, 1, 'Done for the night', 'I''m gonna come back in 20 minutes and assign my last 5 laborers to the farm, then that''s it for the night.\r\rWhy is there a time period between assigning to farm of 20 min and building lumber outpost of 5 min anyways? Aren''t all resources equal? I''d prefer no time to assign workers, but to be fair to wood, wheat assign time should be the same unless it''s a game balance thing.', 0, 1, '2010-09-06 04:02:36'),
(22, 1, 3, 'Re: Done for the night', 'no, the resources arent all the same.. we dont want everything to feel the same', 0, 1, '2010-09-06 04:05:17'),
(23, 3, 1, 'possible bug with number of laborers shown', 'My max laborers is 20. I have 5 laborers at lumber mill building outpost. I already have 5 at my farm. 5 are being assigned to farm, yet it shows I have 6 idle laborers. I should have 5 idle laborers. They will be assigned to farm also in 20 minutes.', 0, 1, '2010-09-06 04:05:26'),
(24, 1, 3, 'Re: possible bug with number of laborers shown', 'You receive laborers automatically.. you prolly already got 1 more .. also, here''s a tree of all buildings and technologies: http://dl.dropbox.com/u/7476/output.png', 0, 1, '2010-09-06 04:07:06'),
(25, 3, 1, 'Re: possible bug with number of laborers shown', 'OK. It does look like I got 1 more laborer.\rPut that tree as a front page link so I can access easily.', 0, 1, '2010-09-06 04:09:03'),
(26, 1, 3, 'Re: possible bug with number of laborers shown', 'It''ll be part of the Help section when it''s done', 0, 1, '2010-09-06 04:15:27'),
(27, 2, 3, 'Re: yo!', 'we''ll see, i put so many easter eggs in the game,,, muahahahahaha', 0, 1, '2010-09-06 16:43:52'),
(28, 3, 2, 'Re: yo!', 'No cheating allowed!', 0, 1, '2010-09-06 23:26:15'),
(29, 3, 1, 'attacking', 'How long does this newbie protection last? I need to attack someone.\rAlso, it''s kind of hard to select the building to attack. How about giving me an attack icon in the info display when I click on any enemy building - just like the current message icon to message a player.\r\rImprovement:\rThe Raid/Assault/Attack combo icons in the attack screen are not very obvious - they need to stand out more - more colorful - red check mark instead of black square. Default my last selected option - if I just want to raid, don''t switch it to the default Assault every time.', 0, 1, '2010-09-07 04:21:50'),
(30, 8, 1, 'City', '\rALL YOUR BASE NOW BELONG TO US', 0, 1, '2010-09-08 03:22:06'),
(31, 1, 8, 'Re: City', 'You, sir, have no chance to survive. Make your time.', 0, 1, '2010-09-08 03:26:13'),
(32, 8, 1, 'Re: City', 'lol\r\rFarmers RISE UP', 0, 2, '2010-09-08 03:29:56'),
