(36, 3, 1, 'farm stuck in transferring workers', 'can you check if my farm is stuck? the timer shows -- -- -- but it just stays there.', 0, 1, '2010-09-09 04:21:15'),
(37, 3, 1, 'world chat', 'Need world chat now to trash talk please.', 0, 1, '2010-09-10 02:21:33'),
(38, 3, 5, 'hi!', 'Hi Vincci!\r\rDo you like the present I''m sending you?', 0, 1, '2010-09-10 19:15:22'),
(39, 3, 1, 'view complete report checkbox', 'Does the View Complete Report checkbox in the battle report viewer do anything? I see nothing changed.', 0, 1, '2010-09-11 03:24:40'),
(40, 3, 5, 'don''t be mad', 'Don''t be mad, Vincci. It''s only a game and I like to trash talk. Sek will protect you soon.', 0, 1, '2010-09-11 03:27:02'),
(41, 3, 1, 'destroying roads', 'Why can''t I destroy roads anymore - was something changed?', 0, 1, '2010-09-11 03:39:36'),
(42, 3, 6, 'attacking seems profitable', 'Attacking seems to be pretty profitable with a big army. I had 44 guys total and it took about 24 resources to make each so army cost was about 1200 resources. I looted 800 resources and only lost 2 guys so net of about 750 and I still have an army to loot again.\r\rThis is even when Vincci was spending all her resources. She has a second basement now so I don''t know how much I''ll get the second time, but at least attacking is as good as farming.\r\rLet''s see, 44 guys would have collected let''s say 50 resources an hour. Attack time total was about 5 hours so those guys would have only made 250 resources during that time farming/lumbering.', 0, 1, '2010-09-11 03:50:03'),
(43, 1, 3, 'Re: destroying roads', 'You can only destroy roads that aren''t connected to anything', 0, 1, '2010-09-11 11:52:41'),
(44, 3, 1, 'what''s going on?', 'Why is my ally attacking me?', 0, 1, '2010-09-11 20:48:34'),
(45, 1, 3, 'Re: what''s going on?', 'sry I had to protect the weak a little bit.. they were crying about it', 0, 1, '2010-09-11 23:16:52'),
(46, 3, 5, 'Yay, level 2!', 'Yay, finally got your building down to level 2. Man, that took forever though, but just wanted to see how that worked. No hard feelings though eh Ci?', 0, 1, '2010-09-12 04:03:39'),
