(167, 3, 1, 'idea: frills game mode', 'Idea for your future features/improvements list.\rIt''s basically a frills mode - I''m thinking this is basically aimed at girls.\rYou know how facebook has poke and gifts and throwing sheep at people. Well, your game can have an action that a player can do once a day like "Flowerize" where the friend''s city becomes a big flower garden with all the tiles decorated in flowers and the walls have vines crawling with flowers. You can have other actions such as "Fireworks" where fireworks pops out from the city. Travian does this (fireworks) when you complete all the tutorial tasks.\r\rNone of this will affect gameplay. Now serious gamers may not want to see any of this. That''s why you can turn Frills mode on or off. You can probably monetize on Frills mode somehow in the future. Remember, the aim is to build community so you want them to log in at least once a day because of the following: 1) Chat with friends - your game can be a big chat server. 2) Frills mode to do stupid stuff. and 3) I just got this idea from Mafia Wars - what they do is you can do a free energy boost to each friend each day - you can do something similar like give each friend 10% resource bonus.', 0, 1, '2010-09-20 04:06:58'),
(168, 1, 3, 'Re: idea: frills game mode', 'We''re already planning on adding something where you can decorate your city. We could make it in the future so you can buy decorations and give it to other people as well perhaps. It''s not hard to do, just a matter of time.', 0, 1, '2010-09-20 04:45:59'),
