(182, 3, 1, 'tracking what screens the users are viewing', 'Have you considered tracking what screens the user currently have visible on his/her browser window? For example you can track how many times the user opened the Messages window or how long the battle in progress window was kept opened.\rYou can do that to:\r1) Have stats for advertisers in the future to show how long a user has been looking at ads they display on that screen. Or tell advertisers which screens are popular.\r2) Track what screens users use most to optimize navigation, usability, and removal if screen is rarely used.', 0, 1, '2010-09-21 02:11:18'),
