(191, 3, 1, 'Tribal Hero backstory', 'You''ll eventually need to create a backstory for the game which explains the goals and resources. Here''s a start:\r\r-The Tribal Hero is what every city aspires to be.\r--He is going to be chosen at the endgame by the Tribal God\r-The Tribal God is the all-knowing all-rewarding god in the game\r--He rewards and punishes\r--He''s responsible for the bonuses of the game when attack\r--He creates the forests\r\r-Assuming you have end-game, the Tribal God is going to ask every city to do something.\r--Maybe build a Wonder of the World\r--Once it''s built, then the city becomes the Tribal Hero and unites the land\r--When someone is trying to build the wonder, everyone should try to go attack them - you''ll indicate on the map who is trying to build a wonder\r', 0, 1, '2010-09-21 20:11:23'),
