(577, 3, 1, 'bugs list', 'Alright, here''s the scoop:\r\rThings you may have fixed:\r1) Attack time calculation - this is way off.\r2) Resource send time calculation - it always shows ''a minute''.\r3) During the battle, the new round text appears before the last group attacks. (minor)\r\rCurrent problems:\r1) Road removal doesn''t highlight the roads that can be removed - you saw this earlier.\r2) When I have 3 new messages and I choose to delete them all without reading, you still display the red notification icon over the pen and paper icon - I guess until the client restarts. (minor)\r3) When a battle starts, it won''t let me view until 5 rounds is done, but when I do finally view, I see there''s only about 10 rounds left.\r4) Workers shouldn''t be lost when farm is knocked down. Same with lumber mill.\r\rThings you might consider changing.\r1) Cannon towers shouldn''t do less damage to troops. If anything, it should do the same damage to troops as Level 5 regular tower and then some extra damage to catapults. It''s an ''upgrade'' for a reason.\r2) You should consider making the user build either a Cannon tower or a regular tower instead of upgrading one to another. Same with Training ground and Barrack. Just make Barrack a little more expensive. This whole upgrade one type to a totally different type is no good.\r3) Relax the range restrictions. I can''t build an armory right now because spots around my university are taken and the only open spot I need for a tribal gathering. Heck, remove building restrictions like that in the first place. Too many restrictions on each building.\r4) Can we change tree growing algorithm to focus on where players are popping up please? I''m tired of scrolling every time a forest depletes.\r5) If a building is brought into battle, it should attack everything and be attacked - what''s this range attack radius thing anyways? This area just needs to be rethought and tweaked.\r6) Move System messages to another tab or somewhere else. I''m tired of seeing resources sent to me messages.\r\rThat''s it for now. Pick and choose whichever you want.', 0, 1, '2010-10-06 02:56:15'),
