(653, 13, 1, 'Re: Not Getting Bonus resource from attack', 'Hmmm, I''ll do the math and let you know.  I had assumed the game had taken it into account before adding the bonus.', 0, 1, '2010-10-09 14:32:31'),
(654, 13, 1, 'Re: Not Getting Bonus resource from attack', 'I''m going to have to pay attention to another raid.  I should be able to get some of the bonus, but didn''t have the capacity to carry all of the bonus.\r\rI want to verify that I have the carrying capacity correct.  If I have a capacity of 100, it means that my troops can carry up to 100 of each resource.  So at most they could carry 100 gold, 100 wood, 100 wheat, and 100 iron.  Or is it supposed to mean that they can carry 100 resources in total (25 gold, 25 wood, 25 wheat, and 25 iron.)', 0, 1, '2010-10-09 14:45:53'),
(655, 3, 6, '(System) QuyenTropolis has sent you resources', '(System) QuyenTropolis has sent you resources', 2, 1, '2010-10-09 15:24:24'),
(656, 3, 13, '(System) QuyenTropolis has sent you resources', '(System) QuyenTropolis has sent you resources', 2, 2, '2010-10-09 15:44:45'),
(657, 1, 13, 'Re: Not Getting Bonus resource from attack', '100 carry = 100 gold, 100 wood, 100 crop, 100 iron ... \r\rIf you have 5 guys then its 500 gold, 500 wood, etc..\r\rIf you''re full then you''ll always get 0 bonus, otherwise, you can only get enough to fill up your carry.. e.g. if you looted 400 and your max is 500 then bonus can only go up to 100', 0, 1, '2010-10-09 19:13:57'),
